import React, {useEffect, useState} from 'react';
import {getAllUsers} from "../../http/userAPI";
import InfoCell from "../../Components/InfoCell/InfoCell";

const UsersListPage = () => {
    const [users, setUsers] = useState(null);
    useEffect(() => {
        async function fetchUsers () {
            const users = await getAllUsers();
            return users;
        }
        fetchUsers().then(users => setUsers(users.data))
    }, [])

    const renderUsers = users !== null && users.map(user => {
        const {email, name, surname, shop_id, role, id} = user;
        return (
            <>
                <div>
                    <span>Имя:</span>
                    <span>{name}</span>
                </div>
                <div>
                    <span>Фамилия: </span>
                    <span>{surname}</span>
                </div>
                <div>
                    <span>Емейл:</span>
                    <span>{email}</span>
                </div>
                <div>
                    <span>Адрес:</span>
                    <span>{shop_id}</span>
                </div>
                <div>
                    <span>Роль:</span>
                    <span>{role}</span>
                </div>
                <div>
                    <span>Name:</span>
                    <span>{name}</span>
                </div>
            </>
        )
    })

    return (
        <div>
            users page list
            {renderUsers}
        </div>
    );
};

export default UsersListPage;
